import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Inventory.css';

function Inventory({ inventory, setInventory }) {
  const [showModal, setShowModal] = useState(false);
  const [openedCards, setOpenedCards] = useState([]);

  // 카드 데이터 (24장 각 타입 1~6티어 카드의 이미지와 이름)
  const cardsData = [
    { name: "Card A", tier: 1, image: "card1.jpg" },
    { name: "Card B", tier: 2, image: "card2.jpg" },
    { name: "Card C", tier: 3, image: "card3.jpg" },
    { name: "Card D", tier: 4, image: "card4.jpg" },
    { name: "Card E", tier: 5, image: "card5.jpg" },
    { name: "Card F", tier: 6, image: "card6.jpg" },
    // 24개의 카드 추가...
  ];

  // 카드팩에서 카드를 5장 뽑는 함수 (확률 기반)
  const drawCards = (cardPack) => {
    const drawnCards = [];
    const packCards = cardsData.filter(card => card.tier === cardPack.tier);

    // 예시: 각 티어별 확률 (1~6티어의 확률 설정)
    const probabilities = {
      1: 0.5, // 티어 1 카드 50% 확률
      2: 0.3, // 티어 2 카드 30% 확률
      3: 0.1, // 티어 3 카드 10% 확률
      4: 0.05, // 티어 4 카드 5% 확률
      5: 0.04, // 티어 5 카드 4% 확률
      6: 0.01, // 티어 6 카드 1% 확률
    };

    for (let i = 0; i < 5; i++) {
      const randomTier = getRandomTier(probabilities); // 확률 기반 티어 뽑기
      const randomCard = getRandomCardFromTier(randomTier, packCards);
      drawnCards.push(randomCard);
    }
    return drawnCards;
  };

  // 확률에 맞는 티어를 뽑는 함수
  const getRandomTier = (probabilities) => {
    const rand = Math.random();
    let cumulativeProb = 0;

    for (let tier = 1; tier <= 6; tier++) {
      cumulativeProb += probabilities[tier];
      if (rand <= cumulativeProb) {
        return tier;
      }
    }
  };

  // 티어에 맞는 카드를 뽑는 함수
  const getRandomCardFromTier = (tier, packCards) => {
    const tierCards = packCards.filter(card => card.tier === tier);
    const randomIndex = Math.floor(Math.random() * tierCards.length);
    return tierCards[randomIndex];
  };

  const openCardPack = (index) => {
    const cardPack = inventory[index];
    const newCards = drawCards(cardPack); // 카드팩에서 카드를 5장 뽑음
    setOpenedCards(newCards);
    setShowModal(true);

    setInventory(prevInventory => {
      const newInventory = [...prevInventory];
      newInventory.splice(index, 1); // 개봉한 카드팩 제거
      return newInventory;
    });
  };

  const closeModal = () => {
    setShowModal(false);
    setOpenedCards([]);
  };

  return (
    <div className="inventory-page">
      <h2>내 인벤토리</h2>
      {inventory.length === 0 ? (
        <div className="inventory-empty">구매한 카드팩이 없습니다.</div>
      ) : (
        <div className="inventory-list">
          {inventory.map((card, index) => (
            <div key={index} className="inventory-item">
              <div className="card-pack">
                <img src={card.image} alt={card.name} className="card-pack-image" />
                <button className="open-button" onClick={() => openCardPack(index)}>
                  카드팩 개봉
                </button>
              </div>
            </div>
          ))}
        </div>
      )}

      {showModal && (
        <div className="modal-overlay">
          <div className="modal-content">
            <div className="modal-card-message">
              새로운 카드가 나왔습니다!
            </div>
            <div className="modal-cards">
              {openedCards.map((card, index) => (
                <div key={index} className="modal-card">
                  <img src={card.image} alt={card.name} className="modal-card-image" />
                  <p>{card.name}</p>
                </div>
              ))}
            </div>
            <button className="close-modal" onClick={closeModal}>닫기</button>
          </div>
        </div>
      )}

      <Link to="/store" className="back-button">상점으로 돌아가기</Link>
    </div>
  );
}

export default Inventory;
